import { Component, OnInit } from '@angular/core';
import { UserServiceService } from '../services/user-service.service';
import { UserStoreService } from '../services/user-store.service';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent implements OnInit{
  constructor(private userService:UserServiceService,private userStoreService:UserStoreService,private groupServi){}
  ngOnInit(): void {
    const email=this.userService.getEmailFromToken();
    this.userStoreService.setEmailToStore(email);
  }
}
